INSERT INTO `contents` (`id`, `name`, `country`, `title`, `logo`, `video`, `videos`, `posts`, `careers`, `brands`, `contacts`, `products`, `awards`, `certifications`, `applications`, `about`, `local`, `created_at`, `updated_at`) VALUES
(1, 'Kid -Guard | للنظافة عنوان', 'Voluptates tenetur u', 'Tempora aspernatur e', '/contents/shad-perez1600396356.png', '/videos/video-home/Kid-Guard.mp4', '<div align=\"center\"><p>الفيديوهات  </p></div><p align=\"center\">\"لوريم\r\n ايبسوم دولار سيت أميت ,كونسيكتيتور أدايبا يسكينج أليايت,سيت دو أيوسمود \r\nتيمبورأنكايديديونتيوت لابوري ات دولار ماجنا أليكيوا . يوت انيم أد مينيم \r\nفينايم,كيواس نوستريأكسير سيتاشن يللأمكو لابورأس نيسي يت أليكيوب أكس أيا \r\nكوممودو كونسيكيوات . ديواسأيوتي أريري دولار إن ريبريهينديرأيت فوليوبتاتي\r\n فيلايت أيسسي كايلليوم دولار أيو فيجايتيولا باراياتيور. أيكسسيبتيور \r\nساينت أوككايكات كيوبايداتات نون بروايدينت ,سيونت ان كيولباكيو أوفيسيا \r\nديسيريونتموليت انيم أيدي ايست لابوريوم.\".</p><p><br></p>', '<p align=\"left\"> \"لوريم\r\n ايبسوم دولار سيت أميت ,كونسيكتيتور أدايبا يسكينج أليايت,سيت دو أيوسمود \r\nتيمبورأنكايديديونتيوت لابوري ات دولار ماجنا أليكيوا . يوت انيم أد مينيم \r\nفينايم,كيواس نوستريأكسير سيتاشن يللأمكو لابورأس نيسي يت أليكيوب أكس أيا \r\nكوممودو كونسيكيوات . ديواسأيوتي أريري دولار إن ريبريهينديرأيت فوليوبتاتي\r\n فيلايت أيسسي كايلليوم دولار أيو فيجايتيولا باراياتيور. </p><p align=\"left\">أيكسسيبتيور \r\nساينت أوككايكات كيوبايداتات نون بروايدينت ,سيونت ان كيولباكيو أوفيسيا \r\nديسيريونتموليت انيم أيدي ايست لابوريوم.\".</p>', '<p align=\"center\">\"لوريم\r\n ايبسوم دولار سيت أميت ,كونسيكتيتور أدايبا يسكينج أليايت,سيت دو أيوسمود \r\nتيمبورأنكايديديونتيوت لابوري ات دولار ماجنا أليكيوا . يوت انيم أد مينيم \r\nفينايم,كيواس نوستريأكسير سيتاشن يللأمكو لابورأس نيسي يت أليكيوب أكس أيا \r\nكوممودو كونسيكيوات . ديواسأيوتي أريري دولار إن ريبريهينديرأيت فوليوبتاتي\r\n فيلايت أيسسي كايلليوم دولار أيو فيجايتيولا باراياتيور </p>', '<p align=\"center\">\"لوريم\r\n ايبسوم دولار سيت أميت ,كونسيكتيتور أدايبا يسكينج أليايت,سيت دو أيوسمود \r\nتيمبورأنكايديديونتيوت لابوري ات دولار ماجنا أليكيوا . يوت انيم أد مينيم \r\nفينايم,كيواس نوستريأكسير سيتاشن يللأمكو لابورأس نيسي يت أليكيوب أكس أيا \r\nكوممودو كونسيكيوات . ديواسأيوتي أريري دولار إ