(1, 1, 'ar', 'Anim occaecat simili', 'Natus est debitis v', '<p><br></p><p>Scout APM is PHP application performance monitoring designed to help \r\ndevelopers quickly pinpoint and resolve performance issues before the \r\ncustomer ever sees them. With easy package installation and support for \r\nboth Laravel and Symfony, Scout APM streamlines proactive and real-time \r\ninsight into performance issues like N+1 queries, memory leaks, and \r\nother abnormalities with tracing logic that ties bottlenecks to source \r\ncode.</p><p>\r\n<br></p><p>Spend less time troubleshooting and more time building great PHP applications with Scout APM.</p><p>\r\n<br></p><p><b>Actionable Performance Insight in Less Than 4 Minutes</b></p><p>\r\n<br></p><p>Scout’s PHP package is safe to run alongside your existing APM \r\nlibrary and gives developers maximal performance insight with minimal \r\nconfiguration. In less than 4 minutes, you’ll have access to:</p><p>\r\n<br></p><p><i>Automatic Tracking of Key Performance Metrics</i></p><p>\r\n<br></p><ul><li>Mean &amp; 95th Percentile Response Time</li><li>Throughput</li><li>Error Rate</li><li>Memory Usage</li><li>Apdex score</li></ul><p>\r\n<br></p><p><i>Automatic Instrumentation of PHP Dependencies</i></p><p>\r\n<br></p><ul><li>Middleware</li><li>Controllers</li><li>SQL Queries</li></ul><p>Incididunt nostrud i.</p>'),
