(3657, '91c095ee-a148-4cc1-a08b-7576513919aa', '91c095ee-a186-4584-b15f-411f59a41294', NULL, 1, 'request', '{\"ip_address\":\"127.0.0.1\",\"uri\":\"\\/api\\/products?_=1602563351190\",\"method\":\"GET\",\"controller_action\":\"App\\\\Http\\\\Controllers\\\\API\\\\ProductsService@products\",\"middleware\":[\"api\"],\"headers\":{\"host\":\"kid-guard.test\",\"user-agent\":\"Mozilla\\/5.0 (Windows NT 10.0; Win64; x64; rv:81.0) Gecko\\/20100101 Firefox\\/81.0\",\"accept\":\"application\\/json, text\\/javascript, *\\/*; q=0.01\",\"accept-language\":\"en-US,en;q=0.5\",\"accept-encoding\":\"gzip, deflate\",\"x-requested-with\":\"XMLHttpRequest\",\"connection\":\"keep-alive\",\"referer\":\"http:\\/\\/kid-guard.test\\/admin\\/products\",\"cookie\":\"XSRF-%3D; laravel_%3D\"},\"payload\":{\"_\":\"1602563351190\"},\"session\":[],\"response_status\":200,\"response\":{\"draw\":0,\"recordsTotal\":4,\"recordsFiltered\":4,\"data\":[{\"id\":3,\"image\":\"<a class=\\\"m-1\\\"><img class=\\\"rounded-square\\\" width=\\\"30\\\" height=\\\"30\\\" src=\\\"http:\\/\\/kid-guard.test\\/products\\/consectetur-aut-eu1600360875.jpeg\\\" alt=\\\"\\\"><\\/a>\",\"price\":560,\"is_displayed\":0,\"capacity_id\":5,\"created_at\":\"2020-09-18T01:41:15.000000Z\",\"updated_at\":\"2020-09-18T01:41:15.000000Z\",\"title\":\"Consectetur aut eu\",\"description\":\"Nostrud qui voluptat\",\"contents\":\"&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Scout APM is PHP application performance monitoring designed to help \\r\\ndevelopers quickly pinpoint and resolve performance issues before the \\r\\ncustomer ever sees them. With easy package installation and support for \\r\\nboth Laravel and Symfony, Scout APM streamlines proactive and real-time \\r\\ninsight into performance issues like N+1 queries, memory leaks, and \\r\\nother abnormalities with tracing logic that ties bottlenecks to source \\r\\ncode.&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Spend less time troubleshooting and more time building great PHP applications with Scout APM.&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Actionable Performance Insight in Less Than 4 Minutes&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Scout\\u2019s PHP package is safe to run alongside your existing APM \\r\\nlibrary and gives developers maximal performance insight with minimal \\r\\nconfiguration. In less than 4 minutes, you\\u2019ll have access to:&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;i&gt;Automatic Tracking of Key Performance Metrics&lt;\\/i&gt;&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;ul&gt;&lt;li&gt;Mean &amp;amp; 95th Percentile Response Time&lt;\\/li&gt;&lt;li&gt;Throughput&lt;\\/li&gt;&lt;li&gt;Error Rate&lt;\\/li&gt;&lt;li&gt;Memory Usage&lt;\\/li&gt;&lt;li&gt;Apdex score&lt;\\/li&gt;&lt;\\/ul&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;i&gt;Automatic Instrumentation of PHP Dependencies&lt;\\/i&gt;&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;ul&gt;&lt;li&gt;Middleware&lt;\\/li&gt;&lt;li&gt;Controllers&lt;\\/li&gt;&lt;li&gt;SQL Queries&lt;\\/li&gt;&lt;\\/ul&gt;&lt;p&gt;Non suscipit rerum e.&lt;\\/p&gt;\",\"translations\":[{\"id\":5,\"product_id\":3,\"locale\":\"ar\",\"title\":\"Consectetur aut eu\",\"contents\":\"&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Scout APM is PHP application performance monitoring designed to help \\r\\ndevelopers quickly pinpoint and resolve performance issues before the \\r\\ncustomer ever sees them. With easy package installation and support for \\r\\nboth Laravel and Symfony, Scout APM streamlines proactive and real-time \\r\\ninsight into performance issues like N+1 queries, memory leaks, and \\r\\nother abnormalities with tracing logic that ties bottlenecks to source \\r\\ncode.&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Spend less time troubleshooting and more time building great PHP applications with Scout APM.&lt;\\/p&gt;&lt;p&gt;\\r\\n&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&